int GetLength(const char *a)
{
    int len_a = 0;
    while (a[len_a++] > 0)
        ;
    return len_a - 1;
}

template <typename T>
T max(T a, T b)
{
    return a > b ? a : b;
}

template <typename T>
T min(T a, T b)
{
    return a < b ? a : b;
}

std::vector<int64_t> GetProduct(const std::vector<int64_t> &a, const std::vector<int64_t> &b, int radix_)
{
    std::vector<int64_t> res(a.size() + b.size());
    for (int i = 0; i < a.size(); ++i)
    {
        int64_t da = a[i];
        for (int j = 0; j < b.size(); ++j)
        {
            int64_t db = b[j];
            int64_t t = da * db + res[i + j];
            res[i + j] = t % radix_;
            res[i + j + 1] += t / radix_;
        }
    }
    return std::move(res);
}

std::vector<int64_t> Shift(const std::vector<int64_t> &x, size_t count)
{
    std::vector<int64_t> res(x.size() + count);
    for (size_t i = 0; i < x.size(); ++i)
    {
        res[i + count] = x[i];
    }
    return std::move(res);
}

std::vector<int64_t> Sub(const std::vector<int64_t> &x, const std::vector<int64_t> &y, int radix_)
{
    // assume x > y

    std::vector<int64_t> res;
    size_t count = max(x.size(), y.size());
    int64_t carry = 0;
    for (size_t i = 0; i < count; ++i)
    {
        int64_t a = i < x.size() ? x[i] : 0;
        int64_t b = i < y.size() ? y[i] : 0;

        int64_t t = a - b + carry;
        if (t < 0)
        {
            res.push_back(t + radix_);
            carry = -1;
        }
        else
        {
            res.push_back(t);
            carry = 0;
        }
    }
    return std::move(res);
}

std::vector<int64_t> Add(const std::vector<int64_t> &x, const std::vector<int64_t> &y, int radix_)
{
    std::vector<int64_t> res;
    size_t count = max(x.size(), y.size());
    int64_t carry = 0;
    for (size_t i = 0; i < count; ++i)
    {
        int64_t a = i < x.size() ? x[i] : 0;
        int64_t b = i < y.size() ? y[i] : 0;

        int64_t t = a + b + carry;
        res.push_back(t % radix_);
        carry = t / radix_;
    }
    if (carry > 0)
        res.push_back(carry);
    return std::move(res);
}

std::vector<int64_t> Mult(const std::vector<int64_t> &x, const std::vector<int64_t> &y, int radix_)
{
    if (x.size() == 0 || y.size() == 0)
        return {};

    if (x.size() == 1 && y.size() == 1)
    {
        int64_t t = x[0] * y[0];
        int64_t carry = t / radix_;
        int64_t rem = t % radix_;

        if (carry > 0)
            return {rem, carry};
        else
            return {rem};
    }

    std::vector<int64_t> res;

    size_t half_size = max(x.size(), y.size()) / 2;
    size_t x_half_size = min(x.size(), half_size);
    size_t y_half_size = min(y.size(), half_size);

    auto xr = std::vector<int64_t>(x.cbegin(), x.cbegin() + x_half_size);
    auto yr = std::vector<int64_t>(y.cbegin(), y.cbegin() + y_half_size);
    auto xl = std::vector<int64_t>(x.cbegin() + x_half_size, x.cend());
    auto yl = std::vector<int64_t>(y.cbegin() + y_half_size, y.cend());

    auto xlyl = Mult(xl, yl, radix_);
    auto xryr = Mult(xr, yr, radix_);
    auto xl_xr_yl_yr = Mult(Add(xl, xr, radix_), Add(yl, yr, radix_), radix_);

    auto xlyr_xryl = Sub(Sub(xl_xr_yl_yr, xlyl, radix_), xryr, radix_);

    return std::move(Add(Shift(xlyl, 2 * half_size), Add(Shift(xlyr_xryl, half_size), xryr, radix_), radix_));

    //return std::move(res);
}

std::vector<int64_t> ToDigitVector(const char *a, int radix_, int digit_len_)
{
    std::vector<int64_t> digits_;
    int len = GetLength(a);
    digits_.resize((len + digit_len_ - 1) / digit_len_);
    int64_t c = 1;
    for (int i = 0; i < len; ++i)
    {
        digits_[i / digit_len_] += (a[len - 1 - i] - '0') * c;
        c = (c * 10) == radix_ ? 1 : c * 10;
    }
    return std::move(digits_);
}
class BigInteger
{
  public:
    BigInteger(const std::vector<int64_t> &a) : digits_(a)
    {
    }
    BigInteger(const char *a): digits_(ToDigitVector(a,radix_,digit_len_))
    {
    }
    BigInteger operator*(const BigInteger &other) const
    {
        return BigInteger(GetProduct(digits_, other.digits_, radix_));
        //return BigInteger(Mult(digits_, other.digits_, radix_));
    }
    std::vector<char> ToCharVector() const
    {
        std::vector<char> res;
        int num_digits = digits_.size();
        for (int i = 0; i < num_digits; ++i)
        {
            int c = radix_;
            int64_t num = digits_[num_digits - 1 - i];
            for (int j = 0; j < digit_len_; ++j)
            {
                c /= 10;
                char t = num / c + '0';
                if (!res.empty() || t > '0')
                {
                    res.push_back(t);
                }
                num %= c;
            }
        }
        if (res.empty())
        {
            res.push_back('0');
        }
        res.push_back(0);
        return std::move(res);
    }

  private:
    const int radix_ = 1000000000;
    const int digit_len_ = 9;
    std::vector<int64_t> digits_;
};

